@EU_Commission @vonderleyen "One third cheaper".

That means that the EU usually adds (an unnecessary) 1/3 to the price of medical equipment entering those European countries.

Shocking when you think about it.

@EU_Commission what are you waiting for taking a clear stand against what is happening in #Hungary? 
#Orban has turned the country into a dictatorship. 
It is intolerable! Action must be taken immediately!

@EU_Commission 
Je pense qu'il est temps que la commission réagisse vigoureusement face à des régimes comme celui d'orban et du gouvernement polonais.
Ces pays doivent être exclus et pas de tergiversations!

@EU_Commission It's time to pursue global #PeaceAndSecurity

#Coronavirus is not a local, regional, or national issue.  It's a GLOBAL problem that we need to face head on.  So are the world's wars and conflicts! They affect us ALL.

NOW is the time for the world to pursue #GlobalCeasefire 🌏 🕊
